import Vue from 'vue'
import VueRouter from 'vue-router'
//import Home from '../views/Home.vue'

Vue.use(VueRouter)
const routes = [{ 
    path:'/',
    name: 'vueHome',
    component: () => import('../views/vueHome.vue')
},
{
    path:'/user',
    name:'vueUser',
    component: () => import('../views/vueUser.vue')
}
]

const router = new VueRouter({
    mode:'history',
    routes
})

export default router
